import React from "react";
import "./App.css";
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";

function App() {
  return (
    <div style={styles.container}>
      <Header pgTitle="My Application" />
      <p>This is the main app</p>
      <Footer />
    </div>
  );
}

export default App;

const styles = {
  container: {
    backgroundColor: "#ccc",
  },
};
